function showNavbar(){document.getElementById("wrapper-mobile-nav").classList.toggle("visible"),document.getElementById("nav-icon3").classList.toggle("open")}function initNavbar(){document.getElementById("nav-icon3").addEventListener("click",showNavbar,!1)}function underlineLinks(){let e=document.querySelectorAll(".page-index"),t=e[0].dataset.page,n="mobile-"+e[0].dataset.page;document.getElementById(t).classList.add("active"),document.getElementById(n).classList.add("active")}